Introducing POAP Fun: A POAP-powered raffle platform for all of your raffling needs. Chimpers NFT use case with community is a good example:
1. Drop POAPs on Spaces; 
2. List worthy prizes;
3. Use http://POAP.Fun to start the draw!
Read more on uses and setting up here - https://poap-fun.super.site/
